COM_MINIORANGE_IMPORTEXPORTUSERS_PLUGIN_OVERVIEW_TEXT="The Joomla Import Export Users plugin allows you to import and export Joomla Users from one Joomla site to another. Permittit te ad novum locum migrare sine usoribus tuis vel clientibus$ satis literam amissis. Potes importare vel exportare user/mos notitias utens CSV imagini. Hoc plugin adiuvat te ad importare et exportare molem Joomla users utens tabella CSV."
COM_MINIORANGE_IMPORTEXPORTUSERS_PLUGIN_OVERVIEW_TEXT1="Your Joomla users can be imported and exported from Joomla 3.x to Joomla 4.x Joomla 5.x and Joomla 6.x and vice versa. Praeterea$ users ex quibusvis aliis websites vel CMS in website tuum facere potes."
