COM_MINIORANGE_IMPORTEXPORTUSERS_PLUGIN_OVERVIEW_TEXT3="The Import-Export Joomla Users Plugin takes CSV file as input. CSV fasciculum creare debes et eum fasciculum impone. Hoc est singulis fasciculi CSV campi congruit cum agrorum usorum particularium$ secus$ Admin necesse est manually inputare. Exempli gratia$ usoris campum deformatum ad Username. Ad plugin recte operandum$ debebis titulos omnium columnarum recte describere et curare ut omnes agros quos intras in recta forma sint. Potes creare CSV de scabere vel exportare usores ut forma CSV. Progressio$ spreadsheet uti potes ut Microsoft Excel$ OpenOffice$ Libre Office$ vel Google Expandendi ad CSV lima creandi ac modificandi. Serva hunc fasciculum in UTF-8 descriptam cum extensione .CSV. Postquam omnia singularia de usoribus in spreadsheet intrantes$ molem importare potes utentes ad Joomla. Cum hoc plugin$ etiam exportare et extrahere potes singula usoris documenti ut CSV."
